// SkillsTab.jsx
import React from "react";

const SkillsTab = ({ skills, isScrolled }) => {
  return (
    <>
      {skills.map((skill, index) => (
        <div
          key={index}
          className={`col-6 col-md-4 col-lg-3 mb-4 text-center skill-card ${
            isScrolled ? "scrolled" : ""
          }`}
        >
          <div className="skill-icon">{skill.icon}</div>
          <p className="skill-desc">{skill.name}</p>
        </div>
      ))}
    </>
  );
};

export default SkillsTab;
